  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117675 includes chemical,
  discrete sample, physical and profile data collected from OCEANUS in the North Atlantic
  Ocean and South Atlantic Ocean from 1988-07-23 to 1988-09-01 and retrieved during
  cruise WOCE A16N 1988. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA HELIUM-3, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON,
  NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, Tritium (Hydrogen isotope) and
  WATER TEMPERATURE. The instruments used to collect these data include CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Mike McCartney, Lynne
  Talley and Mizuki Tsuchiya of Scripps Institution of Oceanography and John L. Bullister
  of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the WOCE_A16N_1988
  data set.nnThe World Ocean Circulation Experiment (WOCE) was a major component of
  the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
